Das Laden der Kartendaten ist fehlgeschlagen, es werden lokale zwischengespeicherte Daten verwendet, aber keine gültige Karte gefunden. Bitte überprüfen Sie:
1. ob die Netzwerkverbindung korrekt ist;
2. ob der Kartenalias korrekt eingestellt ist;
3. ob die benötigten Punkte für den Aufzug definiert sind;
4. ob in der Karte gültige Punkte und Routen vorhanden sind.

